import (
	context "context"
	fern "github.com/property-access/fern"
	fernclient "github.com/property-access/fern/client"
)

client := fernclient.NewClient()
response, err := client.CreateUser(
	context.TODO(),
	&fern.User{
		Id:       "id",
		Email:    "email",
		Password: "password",
		Profile: &fern.UserProfile{
			Name: "name",
			Verification: &fern.UserProfileVerification{
				Verified: "verified",
			},
			Ssn: "ssn",
		},
	},
)
